#
# TABLE STRUCTURE FOR: addressmaster
#

DROP TABLE IF EXISTS `addressmaster`;

CREATE TABLE `addressmaster` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `EntityId` int(11) NOT NULL,
  `EntityType` varchar(250) NOT NULL,
  `AddressType` int(11) NOT NULL,
  `Address1` varchar(250) NOT NULL,
  `Address2` varchar(250) DEFAULT NULL,
  `Address3` varchar(250) DEFAULT NULL,
  `Country` int(11) NOT NULL,
  `State` int(11) NOT NULL,
  `City` int(11) NOT NULL,
  `PostalCode` varchar(250) DEFAULT NULL,
  `Status` varchar(250) NOT NULL,
  `CreatedBy` int(11) NOT NULL,
  `UpdatedBy` int(11) DEFAULT NULL,
  `CreatedOn` datetime NOT NULL,
  `UpdatedOn` datetime DEFAULT NULL,
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

